import React, { Component } from "react";
import {
  StyleSheet,
  Button,
  View,
  Text,
  TouchableOpacity,
  Image,
} from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

export default class QuestScreen extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <View style={styles.MainContainer}>
        <TouchableOpacity
          style={{ backgroundColor: "dodgerblue" }}
          activeOpacity={0.5}
        >
          <Image
            source={require("../app/assets/home.png")}
            style={styles.ImageStyle}
          />
          <Text style={styles.TextStyle}>Home</Text>
          {/* <Button
            title="Home"
            onPress={() => this.props.navigation.navigate("Home")}
          /> */}
        </TouchableOpacity>

        <View style={styles.TextStyle}>
          <Text>Quest Page</Text>
        </View>
        <TouchableOpacity
          style={{ backgroundColor: "dodgerblue" }}
          activeOpacity={0.5}
        >
          <Image
            styles={styles.ImageStyle}
            source={require("../app/assets/money-bag.png")}
          />
          <Text style={styles.TextStyle}>Reward Points</Text>
        </TouchableOpacity>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  MainContainer: {
    flex: 1,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "flex-start",
  },
  TextStyle: {
    // backgroundColor: "#fff",
    marginBottom: 4,
    marginRight: 20,
  },
  ImageStyle: {
    backgroundColor: "#fff",
    width: "20%",
    // marginBottom: 4,
    // marginRight: 20,
  },
  SeparatorLine: {
    backgroundColor: "#fff",
    width: 1,
    height: 40,
  },
});

